    true,nt"url": null,nt"notes": "<p>Hospital Outpatient Prospective Payment
    System (OPPS) Partial Hospitalization Program LDS<br />nThis file contains select
    claim level data and is derived from 2010 claims for partial hospitalization program
    (PHP) services, with dates of service from January 1, 2010 - December 31, 2010 that
    were received, processed, and paid through December 31, 2010.  This file includes
    data elements such as diagnosis codes, bill type, outlier payments, and service
    revenue payments.  This file includes 328,353 claims for PHP services furnished
    by hospitals and community mental health centers (CMHCs) paid under the OPPS. This
    is a flat file.  The LDS record length is 9,977, blocksize is 32,760.</p>n",nt"license_title":
